import react, {useState} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import {BrowserRouter, Routes, Route} from 'react-router-dom';




function App() {
  return(
    <BrowserRouter>
    <Routes>
      <Route path='home' element={<Home/>}/>
    </Routes>
  </BrowserRouter>
  )
}

export default App;
